ISLAMABAD, Jul 04 (APP):Chairman Senate Syed Yusuf Raza Gillani on Thursday announced the panel of Presiding officers to act in absence of both the Chairman and Deputy Chairman for 340th Senate session.
The Chairman chaired the proceedings of 340th Senate session, commenced on the very day. The panel of Presiding officers comprises Anusha Rehman, Saleem Mandviwalla and Khalida Lateef.
